import React from "react";
import "./Slider.css";

import videocall from "../IMGS/videocall.jpeg";
import main from "../IMGS/main.jpeg";
import mainmini from "../IMGS/mainmini.jpeg";

function Slider() {
  return (
    <div>
      <div>
        <img src={main} className="chat"/>
      </div>
      <div>
        <img src={mainmini} className="audio"/>
      </div>
      <div>
        <img src={videocall} className="video"/>
      </div>
    </div>
  );
}

export default Slider;
